        bool tokenIdAlreadyAdded = false;
        uint256[] storage validTokenIds = validTokenIdsByContract[contractAddress];

        uint256 index;
        for (index = 0; index < validTokenIds.length; index++) {
            uint256 validTokenId = validTokenIds[index];
            if (validTokenId == tokenId) {
